      SELECT DISTINCT + - 99 * 89 + - col2 AS col2 FROM tab0 (FORMAT parquet) AS cor0 WHERE + col1 * - + col1 + + ( - - col1 ) * + - col1 >= - 29;
  - name: tab0

outputs:
